  \"2015-09-26T19:34:53.601392\",\n\t\"name\": \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-northern-california-hydro-hydro\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains vector lines and
  polygons representing coastal hydrography used in the creation of the Environmental
  Sensitivity Index (ESI) for Northern California. The HYDRO data layer contains all
  annotation used in producing the atlas. The annotation features are categorized
  into three subclasses in order to simplify the mapping and quality control procedures:
  GEOG for geographic features, SOC for socioeconomic features, and HYDRO for water
  features. This data set comprises a portion of the ESI data for Northern California.
  ESI data characterize the marine and coastal environments and wildlife by their
  sensitivity to spilled oil. The ESI data include information for three main components:
  shoreline habitats, sensitive biological resources, and human-use resources.\",\n\t\"license_title\":
